import Logements from "../logements.json"
import '../Styles/index_Fiche_Logements.css'

function Fiche_Logement() {    
    Logements.map((logement) => {
        console.log(logement);
        return null;
    });

    return (
        <div className="space_Logement">
        {Logements.map((logement, id) => (
            <div key={id}>{logement.title}</div>
            ))}
        </div>
    );
}

export default Fiche_Logement;
